    public void mapEntityToDataSource(DataEntityRuntimeContext _entityCtx, DataEntityDataSourceRuntimeContext _dataSourceCtx)
    {
        super(_entityCtx, _dataSourceCtx);
        if ((_entityCtx.getDatabaseOperation() == DataEntityDatabaseOperation::Insert
            || _entityCtx.getDatabaseOperation() == DataEntityDatabaseOperation::Update))
        {
            switch (_dataSourceCtx.name())
            {
                case dataEntityDataSourceStr(InventQualityOrderHeaderEntity, InventQualityOrderTable):
                    InventQualityOrderTable inventQualityOrderTable = _dataSourceCtx.getBuffer();

                    inventQualityOrderTable.initBlockingQty(InventQualityReferenceType::newFromQualityOrder(inventQualityOrderTable));

                    if (this.CustomerAccountNumber && this.SalesorderNumber)
                    {
                        inventQualityOrderTable.AccountRelation = this.CustomerAccountNumber;
                        inventQualityOrderTable.ReferenceType   = this.QualityOrderPolicyType;
                        inventQualityOrderTable.InventRefId     = this.SalesorderNumber;
                    }
                    else if (this.VendorAccountNumber && this.PurchaseOrderNumber)
                    {
                        inventQualityOrderTable.AccountRelation = this.VendorAccountNumber;
                        inventQualityOrderTable.ReferenceType   = this.QualityOrderPolicyType;
                        inventQualityOrderTable.InventRefId     = this.PurchaseOrderNumber;
                    }
                    else if (this.ProductionOrderNumber)
                    {
                        inventQualityOrderTable.AccountRelation = '';
                        inventQualityOrderTable.ReferenceType   = this.QualityOrderPolicyType;
                        inventQualityOrderTable.InventRefId     = this.ProductionOrderNumber;
                    }
                    break;
                case dataEntityDataSourceStr(InventQualityOrderHeaderEntity, InventDim):
                    InventDim inventDim = this.InventInventoryDimensionEntityFieldsMapping::resolveInventDim();
                    _dataSourceCtx.setBuffer(inventDim);

                    var qualityOrderContext = _entityCtx.getRuntimeContextByName(dataEntityDataSourceStr(InventQualityOrderHeaderEntity, InventQualityOrderTable));

                    InventQualityOrderTable qualityOrder = qualityOrderContext.getBuffer();
                    qualityOrder.InventDimId = inventDim.inventDimId;
                    break;
            }
        }
    }
